import React, { Component } from "react";
const token = sessionStorage.getItem("token") ;

class Profile extends Component {
    state = { username: ""};

    render() 
    {
        return(
            <main className="Profile">
                {(token && token!="" && token!=undefined)? "You are logged in":
				<h1>Not Logged In</h1>
                }
            </main>
        );
    }
}

export default Profile;
